import React from "react";
import FlipCard from '../FlipCard'
import Road from "../Road"
import {Bar, Doughnut, Polar, Radar, HorizontalBar} from 'react-chartjs-2';


function RoadLevel2(props) {

    return(
        <div style = {{display: 'flex', flexDirection: 'column', marginLeft:'-0.92em' 
        }}>
                <Road 
                      width={'10em'}
                      height={'9.7em'}
                      StylingInfo = {'horizontal-road2'}
                      dashType = {'horizontal-dashC'}
                    />
                    
                <Road 
                     width={'10em'}
                     height={'5em'}
                     StylingInfo = {'vertical-road2'}
                     dashType = {'vertical-dash'}
                />
                <div
                style ={{marginBottom:'-1.3%', marginLeft:'-25%'}}
                >
                <FlipCard
                    width = {"25em"}
                    height = {"24em"}
                    FlipStyle = {{ backgroundImage:'url("/ML.jpg")',
                    backgroundSize: '110%', 
                    backgroundRepeat: 'none',
                    backgroundPosition: 'center'}} 
                    // Front=
                    // {
                    //   <div>
                    //     <h1 className = 'progLang-hF'>
                    //     {props.mlChartData.frontTitle}
                    //     </h1>
                    //   </div>
                    // }
                    Back = {
                      <div>
                        <Doughnut data={props.mlChartData}
                          options= {props.mlChartData.options}
                        />
                      </div>
                        }
                  >
                  </FlipCard>
                </div>  
                  <Road 
                     width={'10em'}
                     height={'5em'}
                     StylingInfo = {'vertical-road'}
                     dashType = {'vertical-dash'}
                       />
                  <Road 
                     width={'10em'}
                     height={'10em'}
                     StylingInfo = {'vertical-road1'}
                     paddingRight = {'6em'}
                     dashType = {'vertical-dashC'}
                  />

        </div>


    )


}

export default RoadLevel2
